  input: 'TEXT,F3XA,,"Amendment 6/28/05:  The Leadership PAC 2004 does not pay any
    full-time employees for management services.  Management fees are paid to Sederholm
    Public Affairs, Inc., a professional consulting firm, which provides management
    services (including overhead and administrative services), bookkeeping, rent,
    postage, utilities, telephone service, office equipment, supplies, etc. All costs/fees
    are included in the monthly billing.  The agreement between Sederholm Public Affairs,
    Inc. and Leadership PAC 2004 is renewed on a yearly or election cycle basis.  Finally,
    the PAC does not engage any volunteer workers.  Original Filing Note:  There is
    no payment in April 2005 for Sederholm Public Affairs, Inc. as we did not receive
    their invoice for April services until May 2005.  Please look for those charges
    in our next report.  Thank you."'
